const numbers = Array.from(Array(20).keys());

const FizzBuzz = (num) =>  {	
num.map((x) => {
if(x+1 == 15n){
	console.log('FizzBuzz');
	return(<li>FizzBuzz</li>);
}
else if(x+1 == 3n){
	console.log('Fizz');
	return(<li>Fizz</li>);
}
else if(x+1 == 5n){
	console.log('Buzz');
	return(<li>Buzz</li>);
}
else {
	console.log(x+1);
	return(<li>{x+1}</li>);
}
})
};
const coolFizzBuzz = (num) => {
  for(var i = 1; i <= num; i++){
    console.log((i % 3 === 0 && i % 5 === 0) ?
                  "fizzbuzz" : (i % 5 === 0 ?
                    "buzz" : (i % 3 === 0 ?
                      "fizz" : i)));
  }
}

function App() {
 return (
    <div className="App">
<ul className="fizzBuzz">

</ul>
    </div>
  );
}

export default App;
